import React from "react";
import { reducerFunction } from "../../helpers";

const initialState = {
  mount: false,
};

export const Body = function (props) {
  const [b, setB] = React.useState(2);
  const [state, setState] = React.useReducer(reducerFunction, initialState);

  React.useEffect(
    function () {
      // get The Date from Api
      setState({
        mount:!state.mount,
      });
    },
    [] //dependeny list
  );

  const clickHandler = function () {
    setB(2 * b);
  };

  return !state.mount ? (
    <div>Loading...</div>
  ) : (
    <div className="body-container">
      {`mount- ${state.mount} -B =${b}`}
      <button onClick={clickHandler}>Update B</button>
    </div>
  );
};
